import React from 'react'
import './css/bootstrap/bootstrap.css';


function Card (props){
    return ( 
    <div className="card" style="width: 18rem;">
        <div className="card-body">
          <h5 className="card-title">{props.title}</h5>
          <p className="card-text"></p>{props.text}</div>
 </div>
      )
}

export default Card;
